var merryChristmasMusic=new Audio('https://www.wasql.com/christmas.wav');merryChristmasMusic.type='audio/wav';merryChristmasMusic.loop=!1;merryChristmasMusic.finish=0;merryChristmasMusic.addEventListener("ended",function(){this.currentTime=0;this.finish=1});function merryChristmas(){if(undefined==this.firsttime||this.firsttime==0){this.firsttime=1;merryChristmasPlaymerryChristmasMusic();console.log('%cMerry Christmas from us to you. https://www.wasql.com','font: 2em cursive; color: #6b6a89;')}
if(merryChristmasMusic.finish==0){merryChristmasBorder();merryChristmasBackground();setTimeout(function(){merryChristmas()},200)}else{merryChristmasStopmerryChristmasMusic();merryChristmasReset();this.firsttime=0;merryChristmasMusic.finish=0}
return!1}
async function merryChristmasPlaymerryChristmasMusic(){try{await merryChristmasMusic.play()}catch(err){console.log('unable to play merryChristmasMusic. sorry')}}
function merryChristmasStopmerryChristmasMusic(){merryChristmasMusic.pause();merryChristmasMusic.currentTime=0}
async function merryChristmasBorder(){let all=document.getElementsByTagName("*");for(let i=0;i<all.length;i++){if(!merryChristmasIsHidden(all[i])){if(undefined==all[i].oriborder){all[i].oriborder=all[i].style.border}
let c=merryChristmasRandomColor();let bc='2px dashed '+c;if(document.body==all[i]){bc='10px dotted '+c}
all[i].style.border=bc}}}
async function merryChristmasBackground(){let all=document.getElementsByTagName("*");for(let i=0;i<all.length;i++){if(!merryChristmasIsHidden(all[i])){if(undefined==all[i].oribackground){all[i].oribackground=all[i].style.background}
let c=merryChristmasRandomColor();let bg=c+'26';all[i].style.background=bg}}}
function merryChristmasReset(){let all=document.getElementsByTagName('*');for(let i=0;i<all.length;i++){if(undefined!=all[i].oriborder){all[i].style.border=all[i].oriborder}
if(undefined!=all[i].oribackground){all[i].style.background=all[i].oribackground}}}
function merryChristmasIsHidden(el){let style=window.getComputedStyle(el);return((style.display==='none')||(style.visibility==='hidden'))}
function merryChristmasRandomColor(){let letters='123456789ABCDEF';let color='#';for(let i=0;i<6;i++){color+=letters[Math.floor(Math.random()*16)]}
return color}